import React from 'react';
import './App.css';

class App extends React.Component {
  render(){
    return (
      <MeditationSetup></MeditationSetup>
    );
  }
} 

class MeditationSetup extends React.Component{
  render(){
    return(
      <div>
        <h1>Welcome to some piece of mind</h1>
        <p>To begin please select the length of time you wish to meditate for</p>
      </div>

    )
  }
}

export default App;
